;; gorilla-repl.fileformat = 1

;; **
;;; # Spelunc-ulation
;;; 
;;; We are in a cave. It is the insides of `clojure.spec.gen`. Implementation details all. Let us … spelunk.
;;; 
;;; ## What’s in here
;;; 
;;; What values do Clojure’s spec generators produce? That is the question very casually explored here.
;;; 
;;; Nothing new or deep is presented here. I recently got introduced to basic data science concepts and met the wonderful [**Gorilla REPL**](http://gorilla-repl.org/) in combination with [**Huri**](https://github.com/sbelak/huri). These tools on top of Clojure’s natural interactivity make it great fun to poke at data, and try to find patterns and make them visible. If this worksheet reads like a shallow advertisement for Gorilla REPL and Huri, it’s because that’s all it is.
;;; 
;;; Don’t let the pictures distract you from noticing how little code you need to do the data transformations and produce the graphs. It is easy and fun!
;;; 
;;; ## Huri
;;; 
;;; We don’t need to take along much, just spec and Huri.
;; **

;; @@
(ns spelunc
  (:require [clojure.spec.alpha :as s]
            [clojure.spec.gen.alpha :as gen]
            [clj-time.coerce :as tc])
  (:use huri.core
        huri.plot))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; The Huri namespaces are meant to be `use`d. Interactively is the intended way of using Huri.
;;; 
;;; Let’s first introduce a helper that creates data frames from spec generator output.
;; **

;; @@
(defn sample
  "Returns a data frame of n samples generated from spec."
  [spec n]
  (->> (gen/sample (s/gen spec) n)
       (map-indexed vector)
       (->data-frame [:index :value])))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;spelunc/sample</span>","value":"#'spelunc/sample"}
;; <=

;; @@
(sample pos-int? 10)
