;; **
;;; That was a sample of ten integers. To Huri’s mind, a ‘data frame’ is nothing more than a sequence of maps.
;;; 
;;; ## Numbers
;;; 
;;; The more samples generated, the more values diverge from the origin.
;; **

;; @@
(def int-df
  (sample nat-int? 100))

(extent :value int-df)
;; @@
