;; **
;;; (`extent` is just one member of a family of functions in `huri.core` for handling data frames.)
;;; 
;;; The values from the integer generator seem to diverge exponentially: notice the log scale on the y-axis.
;; **

;; @@
(scatter-plot :index :value {:y-scale :log} int-df)
