;; **
;;; Values are initially generated near the lower bound, then suddenly the majority seem to leap to the upper half of the domain.
;; **

;; @@
(->> range-df
     (where {:index [< 100]})
     (derive-cols {:past-20 [(partial < 20) :index]})
     (box-plot :past-20 :value))
