;; <=

;; **
;;; How odd!
;;; 
;;; ## Strings
;;; 
;;; Strings are made up of `char`s in Clojure.
;; **

;; @@
(def char-df
  (sample char? 200))

(->> char-df
     (update-cols {:value int})
     (extent :value))
