;; **
;;; Any gaps? A heatmap would show.
;; **

;; @@
(defn- charcode-fn [f n]
  (fn [char]
    (f (int char) n)))

(def charcode-col (partial charcode-fn quot))
(def charcode-row (partial charcode-fn rem))

(->> (sample char? 500)
     (derive-cols {:col [(charcode-col 16) :value]
                   :row [(charcode-row 16) :value]})
     (rollup-fuse [:col :row] {:count count})
     (heatmap :col :row :count))
