;; **
;;; The heatmap should reveal a more interesting pattern here.
;; **

;; @@
(defn char-row [char]
  {:char char})

;; rollup-cat is just a paraphrase of (mapcat :value) from a moment ago. Since
;; data frames are plain Clojure collections, clojure.core functions are as
;; appropriate as the huri.core utilities.
(->> string-df
     (rollup-cat :index (papply map char-row) :value)
     (derive-cols {:col [(charcode-col 10) :char]
                   :row [(charcode-row 10) :char]})
     (rollup-fuse [:col :row] {:count count})
     (heatmap :col :row :count))
