;; <=

;; **
;;; Clearly, the ten digits are in a class of their own frequency-wise.
;;; 
;;; Similarly obvious are the two blocks of the 26 upper and lower case ASCII letters. String contents are rather narrowly restricted then – no whitespace, punctuation, or the fancier Unicode characters.
;;; 
;;; About that preference for digits … is the ratio constant or does it change over time?
;; **

;; @@
(def digits (set "0123456789"))

(defn count-through
  "Returns the number of items in coll, subject to the given transformation.
  Returns a curried version when no collection is supplied."
  ([xf]
   (partial count-through xf))
  ([xf coll]
   (let [rf (completing (fn [n _] (inc n)))]
     (transduce xf rf 0 coll))))

(def string-df'
  (->> string-df
       (derive-cols {:alpha-count [(count-through (remove digits)) :value]
                     :digit-count [(count-through (filter digits)) :value]})))

(rate :digit-count :alpha-count string-df')
