;;; ## Time
;;; 
;;; Again some surprise. Instant values linger at the lower bound – certainly not too common a distribution?
;; **

;; @@
(def inst-range-df
  (->> (sample (s/inst-in #inst "2000-01-01", #inst "2018-12-31") 100)
       (update-cols {:value tc/from-date})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;spelunc/inst-range-df</span>","value":"#'spelunc/inst-range-df"}
;; <=

;; **
;;; (Huri mandates use of clj-time, hence the conversion via `clj-time.coerce/from-date`.)
;; **

;; @@
(scatter-plot :index :value inst-range-df)
