;; <=

;; **
;;; ## Compound values
;;; 
;;; What is inside generated collections and other aggregates? ‘What type?’ could be a first question.
;; **

;; @@
(defn type-name [x]
  (if (nil? x)
    "nil"
    (.getTypeName (class x))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;spelunc/type-name</span>","value":"#'spelunc/type-name"}
;; <=

;; **
;;; For example, `vector?`s.
;; **

;; @@
(def vector-df
  (sample vector? 100))

(defn items+types
  [df]
  (->> df
       (rollup-cat :index (papply map #(hash-map :item %)) :value)
       (derive-cols {:type [type-name :item]})))

(->> vector-df
     items+types
     (rollup-fuse :type {:count count})
     (bar-chart :type [:count] {:flip? true}))
