;; <=

;; **
;;; While there are no nested collections here, the logically equivalent `(s/coll-of any? :kind vector?)` seems to consist *only* of nested collections!
;; **

;; @@
(def coll-df
  (sample (s/coll-of any? :kind vector?) 100))

(->> coll-df
     items+types
     (rollup-fuse :type {:count count})
     (bar-chart :type [:count] {:flip? true}))
