;; <=

;; **
;;; That’s a lot of `nil`s.
;;; 
;;; Not an aggregate value, but idents too can be decomposed into their namespace and name.
;; **

;; @@
(def ident-df
  (sample (s/coll-of ident?) 100))

(defn ident-row [ident]
  {:ident ident
   :type (type-name ident)})

(->> ident-df
     (rollup-cat :index (papply map ident-row) :value)
     (rollup-fuse :type {:simple [count :ident {:ident simple-ident?}]
                         :qualified [count :ident {:ident qualified-ident?}]})
     (bar-chart :type [:simple :qualified] {:flip? true, :show-values? true}))
